(function(){const e=localStorage.getItem("isLoggedIn");if(e){window.location.href="indexlogged.html"}const t=document.getElementById("accountForm");t.addEventListener("submit",(function(e){e.preventDefault();const t=document.getElementById("username").value;const n=document.getElementById("passw").value;const o=JSON.parse(localStorage.getItem("registeredUsers"))||[];const s=o.find((e=>e.username===t&&e.password===n));if(s){alert("Login successful!");localStorage.setItem("isLoggedIn","true");window.location.href="indexlogged.html"}else{alert("Invalid credentials. Try again.")}}))})();